import React from 'react';
import { connect } from 'react-redux';

import './Profile.scss';
import LazyLoadImage from '../../components/LazyLoadImage/LazyLoadImage';


const Profile = ({ user }) => {
  const {
    fn,
    photo,
    tel,
  } = user;

  return (
    <section className="profile">
      <div className="profile__avatar">
        <LazyLoadImage src={photo} />
      </div>

      <ul className="profile__info-list card">
        <div className="profile__info">Name:</div>
        <div className="profile__info">Email:</div>
        <div className="profile__info">Phone:</div>
      </ul>
      <ul className="profile__info-list card">
        <div className="profile__info">{user.fn}</div>
        <div className="profile__info">{user.email}</div>
        <div className="profile__info">{user.tel}</div>
      </ul>
    </section>
  )
}

const mapStateToProps = (state) => ({
  user: state.user,
});

export default connect(mapStateToProps)(Profile);
